pragma solidity >=0.4.0 <0.7.0;
pragma experimental ABIEncoderV2;
import "./Generador.sol";
import "./Comercializador.sol";
import "./models/InfoContrato.sol";
import "./libraries/Validations.sol";

contract MVMFactory {

    address public owner;
    address public dirContrato;

    infoContrato[] generadoresOwners;
    infoContrato[] comercializadoresOwners;

    mapping (address => address) public DirContratosGeneradores;
    mapping (address=>address) public DirContratosComercializadores;

    event CreacionGenerador (string, address);
    event CreacionComercializador (string, address);
    using Validations for *;

    constructor () public {
        owner = msg.sender;
        dirContrato = address (this);
    }

    function factoryGenerador (string memory nombreGenerador, uint cantidadTokens) public {
        require(msg.sender.aproveCreation(generadoresOwners),"Una direccion no puede tener mas de un generador");
        DirContratosGeneradores[msg.sender] = address (new Generador(nombreGenerador,msg.sender, cantidadTokens));
        generadoresOwners.push(infoContrato (msg.sender,DirContratosGeneradores[msg.sender]));
        emit CreacionGenerador(nombreGenerador, DirContratosGeneradores[msg.sender]);
    }   
    
    function factoryComercializador (string memory nombreComercializador) public {
        require(msg.sender.aproveCreation(comercializadoresOwners),"Una direccion no puede tener mas de un comercializador");
        DirContratosComercializadores[msg.sender] = address (new Comercializador(nombreComercializador,msg.sender,dirContrato));
        comercializadoresOwners.push(infoContrato(msg.sender,DirContratosComercializadores[msg.sender]));
        emit CreacionComercializador(nombreComercializador, DirContratosComercializadores[msg.sender]);
    }

    function getGeneradoresOwners () public view returns (infoContrato[] memory){
        return generadoresOwners;
    }   

    function getComercializadoresOwners () public view returns (infoContrato[] memory){
        return comercializadoresOwners;
    }

    function existeGenerador (address contractDir, infoContrato[] memory arrayContracts) public pure returns (bool){
        return contractDir.existsContract(arrayContracts);
    }
}
